import React, { useState } from 'react';
import Layout from '../components/Layout';

function EditMovie() {
  const [movieTitle, setMovieTitle] = useState('The Dark Knight');
  const [director, setDirector] = useState('Christopher Nolan');
  const [imageUrl, setImageUrl] = useState('https://image.tmdb.org/t/p/w500/qJ2tW6WMUDux911r6m7haRef0WH.jpg');
  const [description, setDescription] = useState('Batman raises the stakes in his war on crime.');
  const [genre, setGenre] = useState('Action');
  const [year, setYear] = useState(2008);

  const handleEditMovie = (e) => {
    e.preventDefault();
    console.log("Movie Edited:", { movieTitle, director, imageUrl, description, genre, year });
  };

  return (
    <Layout>
      <div className="container my-5">
        <div className="row">
          {/* Edit Movie Form */}
          <div className="col-md-6 bg-dark text-white p-4 rounded shadow-sm">
            <h1 className="text-center mb-4 text-warning">Edit Movie</h1>
            <form onSubmit={handleEditMovie}>
              <div className="mb-3">
                <label className="form-label">Movie Title</label>
                <input
                  type="text"
                  value={movieTitle}
                  onChange={(e) => setMovieTitle(e.target.value)}
                  className="form-control bg-dark text-white border-secondary"
                  required
                />
              </div>
              <div className="mb-3">
                <label className="form-label">Director</label>
                <input
                  type="text"
                  value={director}
                  onChange={(e) => setDirector(e.target.value)}
                  className="form-control bg-dark text-white border-secondary"
                  required
                />
              </div>
              <div className="mb-3">
                <label className="form-label">Image URL</label>
                <input
                  type="text"
                  value={imageUrl}
                  onChange={(e) => setImageUrl(e.target.value)}
                  className="form-control bg-dark text-white border-secondary"
                  required
                />
              </div>
              <div className="mb-3">
                <label className="form-label">Description</label>
                <textarea
                  value={description}
                  onChange={(e) => setDescription(e.target.value)}
                  className="form-control bg-dark text-white border-secondary"
                  required
                />
              </div>
              <div className="mb-3">
                <label className="form-label">Genre</label>
                <input
                  type="text"
                  value={genre}
                  onChange={(e) => setGenre(e.target.value)}
                  className="form-control bg-dark text-white border-secondary"
                  required
                />
              </div>
              <div className="mb-3">
                <label className="form-label">Year</label>
                <input
                  type="number"
                  value={year}
                  onChange={(e) => setYear(e.target.value)}
                  className="form-control bg-dark text-white border-secondary"
                  required
                />
              </div>
              <button type="submit" className="btn btn-warning w-100">Save Changes</button>
            </form>
          </div>

          {/* Current Movie Info */}
          <div className="col-md-6">
            <h2 className="text-center mb-4 text-warning">Current Movie Info</h2>
            <img
              src={imageUrl}
              alt={movieTitle}
              className="img-fluid rounded shadow mb-4"
            />
            <p className="text-white"><strong>Title:</strong> {movieTitle}</p>
            <p className="text-white"><strong>Director:</strong> {director}</p>
            <p className="text-white"><strong>Genre:</strong> {genre}</p>
            <p className="text-white"><strong>Year:</strong> {year}</p>
            <p className="text-white"><strong>Description:</strong> {description}</p>
          </div>
        </div>
      </div>
    </Layout>
  );
}

export default EditMovie;
